    0 16px 16px rgba(0,0,0,0.16);
}


.hover.shadow-1:hover {
    box-shadow: 0 2px 1px rgba(0,0,0,0.02), 
    0 4px 2px rgba(0,0,0,0.02), 
    0 8px 4px rgba(0,0,0,0.02), 
    0 16px 8px rgba(0,0,0,0.02),
    0 32px 16px rgba(0,0,0,0.02);  
